import React from 'react';

const Header = () => {
  return (
    <header className="bg-gradient-to-r from-blue-600 to-purple-600 text-white shadow-lg">
      <div className="container mx-auto px-4 py-6 flex items-center justify-between">
        <div className="flex items-center space-x-4">
          <svg className="w-10 h-10" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" 
                  d="M9 3v2m6-2v2M9 19v2m6-2v2M5 9H3m2 6H3m18-6h-2m2 6h-2M7 19h10a2 2 0 002-2V7a2 2 0 00-2-2H7a2 2 0 00-2 2v10a2 2 0 002 2zM9 9h6v6H9V9z" />
          </svg>
          <div>
            <h1 className="text-2xl font-bold tracking-tight">Data Structures & Algorithms</h1>
            <p className="text-sm opacity-80">Visualize and Master Complex Concepts</p>
          </div>
        </div>
        <nav className="flex space-x-6">
          <a href="#home" className="hover:text-blue-200 transition-colors">Home</a>
          <a href="#structures" className="hover:text-blue-200 transition-colors">Structures</a>
          <a href="#algorithms" className="hover:text-blue-200 transition-colors">Algorithms</a>
          <a href="#visualizer" className="hover:text-blue-200 transition-colors">Visualizer</a>
        </nav>
      </div>
    </header>
  );
};

export default Header;
